import { Route, Routes } from 'react-router';
import './App.css';
import { Header } from './components/Header';
import { Home } from './components/Home';

function App() {
  return (
    <div className="App">
      <Header />
      <Routes>
      <Route path='/' element={<Home />}></Route>
      </Routes>

    </div>
  );
}

export default App;
